import { isTheme } from "@ui5/webcomponents-base/dist/config/Theme.js";
import pathDataV4 from "./v5/slim-arrow-down.js";
import pathDataV5 from "./v4/slim-arrow-down.js";
const pathData = isTheme("sap_horizon") ? pathDataV5 : pathDataV4;
export default { pathData };
